// src/pages/Dashboard.js
import React, { useEffect, useState, useRef } from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import { motion } from "framer-motion";
import { FaChevronLeft, FaChevronRight } from "react-icons/fa";

const Dashboard = () => {
  const [sessions, setSessions] = useState([]);
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  const slides = [
    {
      img: "/hero1.png",
      slogan: "Breathe. Relax. Renew."
    },
    {
      img: "https://source.unsplash.com/1600x500/?meditation",
      slogan: "Find Peace Within"
    },
    {
      img: "https://source.unsplash.com/1600x500/?wellness",
      slogan: "Your Wellness Journey Starts Here"
    }
  ];

  const [currentSlide, setCurrentSlide] = useState(0);
  const slideInterval = useRef(null);

  useEffect(() => {
    fetch("http://localhost:8000/sessions")
      .then((res) => res.json())
      .then((data) => setSessions(data))
      .catch((err) => console.error(err));
  }, []);

  // Auto-slide
  useEffect(() => {
    startAutoSlide();
    return () => stopAutoSlide();
  }, [currentSlide]);

  const startAutoSlide = () => {
    stopAutoSlide();
    slideInterval.current = setInterval(() => {
      nextSlide();
    }, 5000);
  };

  const stopAutoSlide = () => {
    if (slideInterval.current) clearInterval(slideInterval.current);
  };

  const nextSlide = () => {
    setCurrentSlide((prev) => (prev + 1) % slides.length);
  };

  const prevSlide = () => {
    setCurrentSlide((prev) => (prev - 1 + slides.length) % slides.length);
  };

  return (
    <div className="bg-gray-50 min-h-screen">
      {/* Navbar */}
      <Navbar onMobileMenuToggle={setMobileMenuOpen} />

      {/* Animated main content shift */}
      <motion.div
        animate={{ marginTop: mobileMenuOpen ? 220 : 64 }}
        transition={{ duration: 0.3 }}
      >
        {/* Hero Carousel */}
        <div className="relative w-full overflow-hidden">
          {/* Slides */}
          {slides.map((slide, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0 }}
              animate={{ opacity: index === currentSlide ? 1 : 0 }}
              transition={{ duration: 0.6 }}
              className="absolute inset-0"
            >
              <img
                src={slide.img}
                alt={`Slide ${index}`}
                className="w-full object-cover h-[300px] sm:h-[400px] md:h-[500px]"
              />
              {/* Overlay slogan */}
              {index === currentSlide && (
                <div className="absolute inset-0 flex flex-col items-center justify-center bg-black/30 text-center px-4">
                  <h2 className="text-white text-2xl sm:text-3xl md:text-5xl font-bold drop-shadow-lg">
                    {slide.slogan}
                  </h2>
                </div>
              )}
            </motion.div>
          ))}

          {/* Arrows */}
          <button
            onClick={() => {
              prevSlide();
              startAutoSlide();
            }}
            className="absolute top-1/2 left-4 -translate-y-1/2 bg-black/40 hover:bg-black/60 text-white p-3 rounded-full transition"
          >
            <FaChevronLeft size={20} />
          </button>
          <button
            onClick={() => {
              nextSlide();
              startAutoSlide();
            }}
            className="absolute top-1/2 right-4 -translate-y-1/2 bg-black/40 hover:bg-black/60 text-white p-3 rounded-full transition"
          >
            <FaChevronRight size={20} />
          </button>

          {/* Indicators */}
          <div className="absolute bottom-4 w-full flex justify-center gap-2">
            {slides.map((_, i) => (
              <div
                key={i}
                onClick={() => {
                  setCurrentSlide(i);
                  startAutoSlide();
                }}
                className={`w-3 h-3 rounded-full cursor-pointer transition-all ${
                  i === currentSlide ? "bg-white scale-110" : "bg-white/50"
                }`}
              />
            ))}
          </div>
        </div>

        {/* Published Sessions */}
        <section className="container mx-auto py-10 px-4">
          <h2 className="text-3xl font-bold mb-6 text-green-700">
            🌿 Published Sessions
          </h2>
          {sessions.length === 0 ? (
            <p className="text-gray-500">No sessions available yet.</p>
          ) : (
            <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
              {sessions.map((session) => (
                <motion.div
                  key={session._id}
                  className="bg-white rounded-lg shadow-lg p-4 hover:shadow-2xl transition"
                  whileHover={{ scale: 1.05 }}
                >
                  <h3 className="text-xl font-semibold text-green-700">
                    {session.title}
                  </h3>
                  <p className="text-gray-500 mt-2">
                    Tags: {session.tags.join(", ")}
                  </p>
                  <a
                    href={session.json_file_url}
                    target="_blank"
                    rel="noreferrer"
                    className="text-blue-500 underline mt-3 block"
                  >
                    View Session Details
                  </a>
                </motion.div>
              ))}
            </div>
          )}
        </section>

        {/* Footer */}
        <Footer />
      </motion.div>
    </div>
  );
};

export default Dashboard;
